import React, { useEffect, useState } from 'react';
import { MapContainer, TileLayer, Marker, Popup, GeoJSON } from 'react-leaflet';
import 'leaflet/dist/leaflet.css';
import L from 'leaflet';
import markerIcon from 'leaflet/dist/images/marker-icon.png';
import markerShadow from 'leaflet/dist/images/marker-shadow.png';

// Set up the default icon for markers
L.Marker.prototype.options.icon = L.icon({
    iconUrl: markerIcon,
    shadowUrl: markerShadow,
    iconSize: [25, 41],
    iconAnchor: [12, 41],
    popupAnchor: [1, -34],
    shadowSize: [41, 41],
});

const center = [-37.8136, 144.9631]; // Melbourne's approximate center

function MarketAnalysis() {
    const [highSalesSuburbs, setHighSalesSuburbs] = useState([]);
    const [geoData, setGeoData] = useState(null);
    const [highRentData, setHighRentData] = useState([]);

    // Fetch high-sales suburb data
    useEffect(() => {
        async function fetchSalesData() {
            try {
                const response = await fetch('/highSalesSuburbData.json');
                if (!response.ok) {
                    throw new Error(`HTTP error! Status: ${response.status}`);
                }
                const suburbData = await response.json();
                setHighSalesSuburbs(suburbData);
            } catch (error) {
                console.error("Failed to fetch high-sales suburb data:", error);
            }
        }

        async function fetchGeoData() {
            try {
                const response = await fetch('/highSalesSuburbs.geojson');
                const data = await response.json();
                setGeoData(data);
            } catch (error) {
                console.error("Error fetching GeoJSON data:", error);
            }
        }

        async function fetchHighRentData() {
            try {
                const response = await fetch('/high_rent_summary.json');
                const data = await response.json();
                setHighRentData(data);
            } catch (error) {
                console.error("Error fetching high-rent data:", error);
            }
        }

        fetchSalesData();
        fetchGeoData();
        fetchHighRentData();
    }, []);

    // Style function to color suburbs based on rent
    const styleSuburb = (feature) => {
        const suburbName = feature.properties.name; // Assuming 'name' field in GeoJSON
        const suburbData = highRentData.find(suburb => suburb.Suburb === suburbName);
        const rent = suburbData ? suburbData.average_rent : 0;

        return {
            color: rent > 400 ? 'red' : rent > 300 ? 'orange' : 'green',
            weight: 1,
            fillOpacity: 0.5
        };
    };

    return (
        <div style={{ display: 'flex', justifyContent: 'center', flexDirection: 'column', alignItems: 'center', gap: '20px', padding: '20px' }}>
            {/* High-Sales Map */}
            <div style={{ width: '80%', maxWidth: '800px', textAlign: 'center', border: '1px solid #ccc', borderRadius: '8px', overflow: 'hidden', marginBottom: '20px' }}>
                <h2>Average Sales Price of Properties</h2>
                <MapContainer center={center} zoom={12} style={{ height: '400px', width: '100%' }}>
                    <TileLayer
                        url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
                        attribution="&copy; <a href='https://www.openstreetmap.org/copyright'>OpenStreetMap</a> contributors"
                    />
                    {highSalesSuburbs.map((suburb, index) => (
                        <Marker
                            key={index}
                            position={[suburb.coordinates.lat, suburb.coordinates.lng]}
                        >
                            <Popup>
                                <strong>{suburb.suburb}</strong><br />
                                Average Sales Price: ${suburb.average_price.toLocaleString()}
                            </Popup>
                        </Marker>
                    ))}
                </MapContainer>
            </div>

            {/* High-Rent Map */}
            <div style={{ width: '80%', maxWidth: '800px', textAlign: 'center', border: '1px solid #ccc', borderRadius: '8px', overflow: 'hidden' }}>
                <h2>Average Rent Prices by Suburb</h2>
                <MapContainer center={center} zoom={10} style={{ height: '400px', width: '100%' }}>
                    <TileLayer
                        url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
                        attribution="&copy; <a href='https://www.openstreetmap.org/copyright'>OpenStreetMap</a> contributors"
                    />
                    {geoData && (
                        <GeoJSON data={geoData} style={styleSuburb} onEachFeature={(feature, layer) => {
                            const suburbName = feature.properties.name;
                            const suburbData = highRentData.find(suburb => suburb.Suburb === suburbName);
                            const rent = suburbData ? suburbData.average_rent : "No data";
                            layer.bindPopup(`<strong>${suburbName}</strong><br />Average Rent: $${rent}`);
                        }} />
                    )}
                </MapContainer>
            </div>
        </div>
    );
}

export default MarketAnalysis;
